// const value = { JsonData };

const Card = (recommendedData) => {
  console.log(recommendedData);
  return (
    <section className="card">
      <CardImage />
      <CardDetails recommendedData={recommendedData} />
    </section>
  );
};

// Card Image
const CardImage = () => {
  return (
    <div className="card-image">
      <img className="card-cover" src={placeHolder} alt="film cover" />
    </div>
  );
};

//   Card Details
const CardDetails = ({ recommendedData }) => {
  console.log(recommendedData);
  return <div>Details</div>;
};

export default Card;
